&lt;b&gt;Итентика
&lt;/b&gt;Мы ищем системного аналитика в команду, занятую разработкой решений в области видеонаблюдения. В частности, решения для умных городов и крупного бизнеса.
Наша команда участвует в разработке сервисов для формирования безопасной среды для граждан, повышения технологичности городской инфраструктуры и уровня жизни.
Проект очень востребован и охватывает всю территорию страны, развивается на протяжении 8 лет. В разработке новых модулей используются современные технологии.

&lt;b&gt;Задачи
&lt;/b&gt;Сбор, анализ и документирование требований;
Анализ, формализация и управление требованиями на разработку ПО;
Разработка и согласование ТЗ, ЧТЗ, функциональных спецификаций;
Разработка диаграмм последовательностей, потоков данных, компонентов системы (совместно с архитекторами);
Выявление технологических рисков по задаче;
Формирование бэклога;

Детали и вопросы пожалуйста уточните у рекрутера компании.

